"use client";

// Importaciones necesarias
import React /* @client */ from "react";
import Image from "next/image";
import Navbar from "../components/navbar";
import styles from "./inventary.module.css";




// Define una interfaz para tus productos
interface Producto {
  id: number;
  name: string;
  image: string;
  cantidad: number;
  precio: string;
  codigo: string;
}



// Tipa tu array de productos usando la interfaz
const productos: Producto[] = [
  {
    id: 1,
    name: "Ultraboost 19 Shoes",
    image:
      "data:image/jpeg;base64,",
    cantidad: 100,
    precio: "120.00",
    codigo: "ABC123",
  },
  {
    id: 2,
    name: "Continental 80 Shoes",
    image:
      "data:image/png;base64,",
    cantidad: 50,
    precio: "80.00",
    codigo: "DEF456",
  },
  // ... otros productos
];

// Marca el componente para que se ejecute en el cliente y use estado
export default function Inventary() {
  
  const [isInfoVisible, setIsInfoVisible] = React.useState(false);

  // Estado para manejar el producto seleccionado
  const [selectedProduct, setSelectedProduct] = React.useState<Producto | null>(
    null
  );

  const handleMouseEnter = () => {
    setIsInfoVisible(true);
  };
  
  const handleMouseLeave = () => {
    setIsInfoVisible(false);
  };

  // Función para manejar el clic en un producto
  const handleProductClick = (producto: any) => {
    setSelectedProduct(producto);
  };

  return (
    <div className={styles.pageLayout}>
      <Navbar />
      <main className={styles.Container}>
        <div className={styles.contenido}>
          <div className={styles.listado}>
            {/* Listado de productos con mini imagen */}
            {productos.map((producto) => (
              <div
                key={producto.id}
                className={styles.producto}
                onClick={() => handleProductClick(producto)}
              >
                <Image
                  src={producto.image}
                  alt={producto.name}
                  width={100}
                  height={100}
                />
                <div className={styles.productoInfo}>
                  <p>{producto.name}</p>
                  <span>Cantidad: {producto.cantidad}</span>
                </div>
              </div>
            ))}
          </div>

          {selectedProduct && (
            <div
              className={styles.detalle}
              onMouseEnter={handleMouseEnter}
              onMouseLeave={handleMouseLeave}
            >
              <Image
                src={selectedProduct.image}
                alt={selectedProduct.name}
                width={300}
                height={300}
                layout="responsive"
              />
              <div
                className={styles.info}
                style={{ display: isInfoVisible ? "block" : "none" }}
              >
                <h2>{selectedProduct.name}</h2>
                <p>Inventario: {selectedProduct.cantidad}</p>
                <p>Precio: {selectedProduct.precio}</p>
                <p>Código: {selectedProduct.codigo}</p>
              </div>
            </div>
          )}
        </div>
      </main>
    </div>
  );
}
